export class FuncionarioDTO {
    id: number;
    nome: string;
    numDep: number;
    salario: number;
    nascimento: Date;


    constructor(nome: string, numDep: number, salario: number, nascimento: Date) {

        this.nome = nome;
        this.numDep = numDep;
        this.salario = salario;
        this.nascimento = nascimento;
    }
}
